package com.example.mobilele.service.impl;

import com.example.mobilele.model.entity.Offer;
import com.example.mobilele.model.entity.enums.EngineEnum;
import com.example.mobilele.repository.OfferRepository;
import com.example.mobilele.service.OfferService;
import org.modelmapper.ModelMapper;
import org.springframework.stereotype.Service;

@Service
public class OfferServiceImpl implements OfferService {
  private final OfferRepository offerRepository;
  private final ModelMapper modelMapper;

  public OfferServiceImpl(OfferRepository offerRepository, ModelMapper modelMapper) {
    this.offerRepository = offerRepository;
    this.modelMapper = modelMapper;
  }

  @Override
  public void initOffers() {
    if (this.offerRepository.count() == 0) {
      Offer firstOffer = new Offer();
      firstOffer.setDescription("Like new!");
      firstOffer.setEngine(EngineEnum.DIESEL);
      firstOffer.setImageUrl("data:image/jpeg;base64,");


    }
  }
}
